import React from 'react';
import './image.scss';

class Image extends React.Component {
    constructor() {
        super();

        this.state = {
            loading: false
        }
    }
    render() {


        return (
            <div className="image">
                <img alt="lala" src={this.props.imageId} onLoad={() => this.setState({loading: true})}/>

            </div>
        )
    }
}

export default Image;
